import{_ as t,c as A,al as a,o as i}from"./chunks/framework.BVh3rIuO.js";const o="data:image/png;base64,",n="/main/assets/github_edit.uvVyD5mU.png",r="data:image/png;base64,",g=JSON.parse('{"title":"Contributing to Documentation","description":"","frontmatter":{"github_branch":"main"},"headers":[],"relativePath":"en/cpp/contributing/documentation.md","filePath":"en/cpp/contributing/documentation.md"}'),s={name:"en/cpp/contributing/documentation.md"};function l(c,e,h,p,d,m){return i(),A("div",null,e[0]||(e[0]=[a('<h1 id="contributing-to-documentation" tabindex="-1">Contributing to Documentation <a class="header-anchor" href="#contributing-to-documentation" aria-label="Permalink to &quot;Contributing to Documentation&quot;">​</a></h1><p>Making quick fixes to existing text or raising issues is very easy. More complicated changes will require you to set up the <a href="https://github.com/GitbookIO/gitbook/blob/master/docs/setup.md" target="_blank" rel="noreferrer">Gitbook toolchain</a>. If you want to help, <a href="./../../#getting-help">get in touch</a>.</p><blockquote><p><strong>Tip</strong> You will need a <a href="https://github.com/" target="_blank" rel="noreferrer">Github</a> login to make and submit changes to this guide.</p></blockquote><h2 id="overview" tabindex="-1">Overview <a class="header-anchor" href="#overview" aria-label="Permalink to &quot;Overview&quot;">​</a></h2><p>This guide is written in <a href="https://github.com/GitbookIO/gitbook/blob/master/docs/syntax/markdown.md" target="_blank" rel="noreferrer">markdown</a> wiki syntax and stored in the Github <a href="https://github.com/mavlink/MAVSDK-docs" target="_blank" rel="noreferrer">mavlink/MAVSDK-docs</a> repo. The book is hosted on <a href="https://www.gitbook.com/" target="_blank" rel="noreferrer">Gitbook.com</a> and is automatically rebuilt whenever the master branch of the repo is updated. You can also rebuild it locally using the <a href="https://github.com/GitbookIO/gitbook/blob/master/docs/setup.md" target="_blank" rel="noreferrer">Gitbook toolchain</a>.</p><p>The <a href="./../api_reference/">API Reference</a> section is compiled from source code into markdown using a <a href="#api-reference">separate toolchain</a> and then copied into Github. Updates to the reference should be made in the <a href="https://github.com/mavlink/MAVSDK" target="_blank" rel="noreferrer">source code repository</a> (see <a href="#api-reference">API Reference</a> below for more information).</p><p>The guide is licensed under <a href="https://creativecommons.org/licenses/by/4.0/" target="_blank" rel="noreferrer">CC BY 4.0</a> - if you make any changes then they will be made available under the same license.</p><h2 id="making-a-quick-fix" tabindex="-1">Making a Quick Fix <a class="header-anchor" href="#making-a-quick-fix" aria-label="Permalink to &quot;Making a Quick Fix&quot;">​</a></h2><p>Simple fixes to an existing page can be made directly on Github:</p><ol><li><p>Click the <strong>Edit</strong> button in the top toolbar to open the page</p><p><img src="'+o+'" alt="Edit page"></p></li><li><p>Make required changes in the editor section near the top of the page.</p></li><li><p>At the bottom of the page, add a comment and select the second radio button to create a new branch.</p><p><img src="'+n+'" alt="Edit page"></p></li><li><p>Follow the on-screen instructions to create a pull request with your change.</p></li></ol><h2 id="raising-an-issue" tabindex="-1">Raising an Issue <a class="header-anchor" href="#raising-an-issue" aria-label="Permalink to &quot;Raising an Issue&quot;">​</a></h2><p>To raise an issue against the documentation:</p><ol><li><p>Open the page with problem content.</p></li><li><p>Click the <strong>Bug</strong> button in the top toolbar.</p><p><img src="'+r+'" alt="Raise bug"></p><p>This will open a bug in Github, seeded with the URL/name for the current page.</p></li><li><p>Enter enough information for someone to understand the problem, and ideally to fix it.</p></li></ol><h2 id="making-a-big-change" tabindex="-1">Making a Big Change <a class="header-anchor" href="#making-a-big-change" aria-label="Permalink to &quot;Making a Big Change&quot;">​</a></h2><p>If you want to make more significant changes or additions to the documentation you will need to set up <em>Git</em> and the <em>Gitbook</em> toolchain (this allows you to render the documentation and check that links work).</p><p>For setup information see: <a href="https://github.com/GitbookIO/gitbook/blob/master/docs/setup.md" target="_blank" rel="noreferrer">Gitbook toolchain</a>.</p><h2 id="api-reference" tabindex="-1">API Reference <a class="header-anchor" href="#api-reference" aria-label="Permalink to &quot;API Reference&quot;">​</a></h2><p>The C++ source code is annotated using comments using <a href="http://doxygen.nl/manual/index.html" target="_blank" rel="noreferrer">Doxygen</a> syntax. You can extract the documentation to markdown files (one per class) on macOS or Linux using the instructions in <a href="./../guide/build_docs.html">Build API Reference Documentation</a>.</p><p>In order to include new API reference in the <em>SDK Documentation</em> it must be manually added to the <a href="https://github.com/mavlink/MAVSDK-docs" target="_blank" rel="noreferrer">Github repository</a>:</p><ul><li>Copy the files into the <a href="https://github.com/mavlink/MAVSDK-docs/tree/main/en/cpp/api_reference" target="_blank" rel="noreferrer">/en/cpp/api_reference</a> folder</li><li><em>New</em> APIs should be added to appropriate sections in the <a href="https://github.com/mavlink/MAVSDK-docs/blob/main/en/SUMMARY.md" target="_blank" rel="noreferrer">MAVSDK-docs/en/SUMMARY.md</a> and <a href="https://github.com/mavlink/MAVSDK-docs/blob/main/en/cpp/api_reference/index.md" target="_blank" rel="noreferrer">/en/cpp/api_reference/index.md</a>.</li></ul>',20)]))}const u=t(s,[["render",l]]);export{g as __pageData,u as default};
